import { getInfo } from '@/api/system/log'
export default {
  data() {
    return {
      visible: false,
      data: '',
      title: '异常描述',
      direction: 'rtl',
      dataForm: {
        creatorTime: ''
      },
      activeKey: '',
      activeName: '',
      id: ''
    }
  },
  computed: {
    creatorTime() {
      return this.jnpf.toDate(this.dataForm.creatorTime, "yyyy-MM-dd HH:mm:ss")
    }
  },
  methods: {
    init(data, type) {
      this.data = data || ''
      this.id = this.data.id || ''
      this.activeKey = type || ''
      this.visible = true
      this.getInfo()
    },
    getInfo() {
      getInfo(this.id).then((res) => {
        this.dataForm = res.data || {}
      })
    },
    goBack() {
      this.$emit('close')
    },
  }
}
